import React from "react";
import Card from "../components/shared/Card";

function AboutPage() {
  return (
    <Card>
      <div className="about">
        <h1>About this Project</h1>
        <p>
          This my first react app and I don't understand much of what I've
          written down
        </p>
        <p>Version 1.0.0</p>

        <p>
          <a href="/">Back to Home</a>
        </p>
      </div>
    </Card>
  );
}

export default AboutPage;
